package com.jiushig.sample;

import android.content.Intent;
import android.os.Bundle;

import com.jiushig.imgpreview.ImageBuilder;

import androidx.appcompat.app.AppCompatActivity;

public class MainActivity extends AppCompatActivity {

    @Override
    protected void onCreate(Bundle savedInstanceState) {
        super.onCreate(savedInstanceState);
        setContentView(R.layout.activity_main);

        findViewById(R.id.btn).setOnClickListener(v -> {
            new ImageBuilder(this)
                    .setUrls(new String[]{"https://images.unsplash.com/photo-1458668383970-8ddd3927deed?ixlib=rb-0.3.5&ixid=eyJhcHBfaWQiOjE2ODQ0fQ&s=3a819ffc36f7749d2cb076e572b9d790&auto=format&fit=crop&w=747&q=80"
                            , "https://xia-weiyang.github.io/image/4.jpg"
                            , "https://xia-weiyang.github.io/image/1.jpg"})
                    .setLandscape(true)
                    .start();
        });


        findViewById(R.id.btn1).setOnClickListener(v -> {
            new ImageBuilder(this)
                    .setUrls(new String[]{"https://xia-weiyang.github.io/image/4.jpg"
                            , "https://xia-weiyang.github.io/image/1.jpg"
                            , "https://images.unsplash.com/photo-1458668383970-8ddd3927deed?ixlib=rb-0.3.5&ixid=eyJhcHBfaWQiOjE2ODQ0fQ&s=3a819ffc36f7749d2cb076e572b9d790&auto=format&fit=crop&w=747&q=80"})
                    .setCurrentUrl("https://xia-weiyang.github.io/image/1.jpg")
                    .start();
        });

        findViewById(R.id.btn2).setOnClickListener(v -> {
            new ImageBuilder(this)
                    .setUrls(new String[]{"https://xia-weiyang.github.io/image/1.jpg"
                            , "https://xia-weiyang.github.io/image/4.jpg"
                            , "https://images.unsplash.com/photo-1458668383970-8ddd3927deed?ixlib=rb-0.3.5&ixid=eyJhcHBfaWQiOjE2ODQ0fQ&s=3a819ffc36f7749d2cb076e572b9d790&auto=format&fit=crop&w=747&q=80",
                            "data:image/png;base64,"})
                    .setModel(ImageBuilder.MODEL_SAVE | ImageBuilder.MODEL_SAVE_BTN)
                    .start();
        });
    }

    @Override
    protected void onActivityResult(int requestCode, int resultCode, Intent data) {
        super.onActivityResult(requestCode, resultCode, data);
    }
}
